description:
Johnny stops by his neighbor's place because his neighbor was supposed to give him a hand with some house work. His neighbor stepped out for a few minutes, but his neighbor's daughter, Elektra Rose, invites Johnny in to wait. Elektra is super bummed that she didn't get to go on spring break with her friend's. She was really looking forward to all that cock she was going to get, but she tries to make the best out of a bad situation by seducing Johnny and getting him to fuck her before her dad gets home.

